// show additional button on website
var overlay = document.createElement('div');
overlay.setAttribute('id', 'overlay') 
overlay.style.position = 'absolute';
overlay.style.top = '5%';
overlay.style.left = '5%';
overlay.style.width = '95%';
overlay.style.height = '95%';
overlay.style.backgroundColor = 'rgba(255, 255, 240, 0.5)';
overlay.style.display = 'none';
overlay.style.zIndex = '10000'
document.body.appendChild(overlay);

// video sizes
let width = 600;
console.log(width)
let height = 400;

var buttonFrame = document.createElement('div');
overlay.appendChild(buttonFrame)
buttonFrame.id = 'buttonFrame'
buttonFrame.style.position = 'fixed'
buttonFrame.style.display = 'flex';
buttonFrame.style.flexDirection = 'row';
buttonFrame.style.alignItems = 'flex-start';
buttonFrame.style.justifyContent = 'flex-start';

var div = document.createElement('div');
div.style.position = 'fixed'
div.style.display = 'flex';
div.style.flexDirection = 'column';
div.style.alignItems = 'flex-start';
div.style.justifyContent = 'flex-start';
div.style.top = '1vw';
div.style.left = '1vw';

var button = document.createElement('img');
// define the image shown as button
button.innerHTML = 'Create or get Sample Entry';
button.id = 'button';
button.style.width = '60px';
button.style.heigth = '60px';
button.style.zIndex = '10000'
document.body.appendChild(button);

div.appendChild(button);
div.style.zIndex = '10000'
document.body.appendChild(div);

var reader = document.createElement('div')
reader.setAttribute('id', 'reader') 
//reader.width = window.innerWidth
//reader.height = window.innerHeight
overlay.appendChild(reader);

var insertButton = document.createElement('img');
insertButton.setAttribute('id', 'insertButton');
buttonFrame.appendChild(insertButton);
insertButton.style.zIndex = '10000'
insertButton.style.width = '100px';
insertButton.style.heigth = '100px';
insertButton.style.display = 'none';
insertButton.style.visibility = 'hidden';

var abortButton = document.createElement('img');
abortButton.setAttribute('id', 'abortButton');
buttonFrame.appendChild(abortButton);
abortButton.style.zIndex = '10000'
abortButton.style.width = '100px';
abortButton.style.heigth = '100px';
abortButton.style.display = 'none';
abortButton.style.visibility = 'hidden';

var msgBoard = document.createElement('input');
overlay.appendChild(msgBoard);
msgBoard.type = 'text';
msgBoard.id = 'msgBoard';
msgBoard.style.visibility = 'hidden';
msgBoard.style.display = 'none';
msgBoard.disabled = 'true';

var inputField = document.createElement('input');
overlay.appendChild(inputField);
inputField.type = 'text';
inputField.id = 'inputField';
inputField.style.display = 'none';
inputField.style.visibility = 'collapse';

inputField.addEventListener("focus", function(){
    inputField.style.color = "black";
    inputField.style.placeholderColor = "black";
});

var resultField = document.createElement('div');
overlay.appendChild(resultField);
resultField.contentEditable = "true";
resultField.type = 'text';
resultField.id = 'resultField';
resultField.style.display = 'none';
resultField.style.visibility = 'collapse';
resultField.disabled = 'true';

